import { useState, useEffect } from 'react'

import styles from '../css/login.module.css'

import Layout from '../component/Layout'
import CardItem from '../component/CardItemList'

import CreditoService from "../services/CreditoService"


const Creditos = () => {

    useEffect(() => {
        reciveUsers();
    }, [])

    const [creditos, setCreditos] = useState([]);

    const reciveUsers = () => {
        CreditoService.getAll()
            .then(res => {
                setCreditos(res.data);
            })
            .catch(console.log)
    }

    return (
        <Layout>
            <div className={`text-center ${styles["container"]}`}>
                <ul className="list-group">
                    <li className="list-group-item">
                        <div className="col-7 row">
                            Nombre
                            <div className="col-4">
                                <span className="align-middle">Monto</span>
                            </div>
                            <div className="col-4">
                                IDK
                            </div>
                            <div className="col-4">
                                IDK
                            </div>
                        </div>
                    </li>
                    {creditos && creditos.map((credito) => (
                        <CardItem key={credito.id} credito={credito} />
                    ))}
                </ul>
            </div>
        </Layout>
    );
}
export default Creditos
